function addMissingMetadata(fields, vendorMetadata) {
  fields.forEach(function(fieldEntry) {
    var match = false

    for (var i = 0; i < vendorMetadata.length; i++) {
      var vendorMetaEntry = vendorMetadata[i];
      if (vendorMetaEntry.vendorPath === fieldEntry.vendorPath) {
        match = true;
        break;
      }
    }
    if (match === false) {
      vendorMetadata.push(fieldEntry);
    }
  });
  return vendorMetadata;
}

function getType(sageType) {
  switch (sageType) {
    case 'varchar':
    case 'enum':
    case 'text':
    case 'monetary':
    case 'sdata/string':
    case 'sdata/choice':
    case 'sdata/multichoice':
    case 'visible_to':
    case 'varchar_auto':
    case 'address':
      return 'string';
    case 'integer':
    case 'sdata/integer':
    case 'sdata/decimal':
    case 'double':
      return 'number';
    case 'date':
    case 'sdata/datetime':
      return 'date';
    case 'sdata/boolean':
      return 'boolean';
    default:
      return sageType;
  }
}

